import React from 'react';
import { View, Text, StyleSheet, FlatList } from 'react-native';

const ListScreen = function() {
  const friends = [
    {name: 'Friend 1', age: '20'},
    {name: 'Friend 2', age: '23'},
    {name: 'Friend 3', age: '25'},
    {name: 'Friend 4', age: '28'},
    {name: 'Friend 5', age: '24'},
    {name: 'Friend 6', age: '23'},
    {name: 'Friend 7', age: '22'},
    {name: 'Friend 8', age: '25'},
    {name: 'Friend 9', age: '27'}
  ];

   return (
    <FlatList 
      showsVerticalScrollIndicator = {false}
      keyExtractor={(friend) => friend.name}
      data={friends} 
      renderItem={({item}) => {
        //destructuring item off of element property.
        // item === { name: "Friend #1"}
        return( 
            <Text style={styles.textStyle}>
              {item.name} - Age {item.age}
            </Text>
        );
      }}
    />
   );
};

const styles = StyleSheet.create({
  textStyle: {
    marginVertical: 50
  }
});

export default ListScreen;
